import React from "react";
import mi from "../../asstes/images/dhoni.png";


const shortsData = [
  { image: mi, title: "PBKsvMI" },
  { image: "gtvmi.jpg", title: "GTvMI" },
  { image: "pbksvrcb.jpg", title: "PBKsvRCB" },
  { image: "lsgvrcb.jpg", title: "LSGvRCB" },
  { image: "pbksvmi2.jpg", title: "PBKsvMI" },
  { image: "srhvkkr.jpg", title: "SRHvKKR" },
  { image: "gtvcsk.jpg", title: "GTvCSK" },
  { image: "pbksvdc.jpg", title: "PBKsvDC" },
];

const ShortsCarousel = () => {
  return (
    <div className="bg-[#0D1126] text-white p-6 rounded-xl overflow-x-auto">
      <h2 className="text-xl font-bold mb-2">Good Morning!</h2>
      <p className="mb-4">Curated shorts for you</p>
      <div className="flex gap-4 overflow-x-scroll scrollbar-hide">
        {shortsData.map((item, index) => (
          <div key={index} className="flex-shrink-0 w-36">
            <img
              src={`/images/${item.image}`}
              alt={item.title}
              className="rounded-xl w-full h-44 object-cover"
            />
            <p className="text-center mt-1">{item.title}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ShortsCarousel;
